К нам в группу инноваций требуется Junior Data Scientist, имеющий (или желающий иметь) компетенции в области обработки естественного языка.

*Чем мы занимаемся:*

Компания Гарант с 1990 года разрабатывает ПО для информационно-правового обеспечения. В  нашей команде мы улучшаем работу системы, внедряем новые продукты и фичи как во внутреннюю инфраструктуру компании, так и в клиентский софт. Сейчас активно начали заниматься разного рода задачами NLP, за долгий период работы накопилось огромное количество текстовых данных, начиная с поисковых запросов, заканчивая вопросами службе поддержки.

*Чем предстоит заниматься:*

Сейчас появилась актуальная задача — обработка клиентских логов поиска по нашей системе. Нужно будет выстроить правильный пайплайн извлечения информации из логов, поэкспериментировать с разными метриками качества поиска, попробовать в сегментацию пользователей и определения паттернов их поиска. Однако этим пул задач не ограничивается, данных огромное количество, поэтому поле для исследования широкое, можно пробовать как и современные архитектуры нейросетей, так и чисто лингвистические методы.

*Что нужно иметь и знать:*

- Высшее, незаконченное высшее техническое образование;
- Хорошую математическую культуру;
- Базовое понимание математической статистики;
- Умение программировать (Python или любой другой язык);
- Хороший английский для чтения технической литературы;
- Навык работы с Linux, Git.

*Будет сильным преимуществом:*

- Опыт работы с логами (извлечение данных, эксперименты с ними), опыт построения метрик оценки качества поиска;
- Знания в области ML (задачи, модели, метрики);
- Знание основ NLP (пайплайн работы с текстами; библиотеки nltk, gensim, sklearn, spacy);
- Знание библиотек для DL (Keras, Tensorflow, PyTorch);
- Опыт разработки и развертывания ML-моделей;
- Знание алгоритмов и структур данных;
- Знание C++;
- Опыт работы в ИТ-компании;
- Наличие своих проектов, участие в соревнованиях по ML;
- Научный интерес к сфере, к статьям с архива.

*Плюсы работы у нас:*

- Возможность совмещать с учебой;
- Свобода действий в рамках задач;
- Возможность увидеть важность вклада в продукт;
- Наукоемкая и исследовательская работа;
- GPU для экспериментов.

